var thresh = global.get("thresholdJarak")
var output = {
    payload: {
        "machineID": msg.payload.machineID,
        "state": [0, 0, 0]
    }
}

for (var i = 0; i < msg.payload.jarak.length; i++) {
    if (msg.payload.jarak[i] < thresh) {
        output.payload.state[i] = 1
    }
    else {
        output.payload.state[i] = 0   //Tidak ada mobil
    }
}

node.status({ fill: "green", shape: "ring", text: "State got" })
return output

