for (var i = 0; i < msg.payload[0].length; i++) {
    msg.payload[0][i]["slot"] = [
        msg.payload[0][i].aisle + msg.payload[0][i].slot0,
        msg.payload[0][i].aisle + msg.payload[0][i].slot1,
        msg.payload[0][i].aisle + msg.payload[0][i].slot2
    ]
    msg.payload[0][i]["state"] = [
        msg.payload[1][i].state0,
        msg.payload[1][i].state1,
        msg.payload[1][i].state2
    ]
}

for (i = 0; i < msg.payload[0].length; i++) {
    delete msg.payload[0][i].aisle;
    delete msg.payload[0][i].slot0;
    delete msg.payload[0][i].slot1;
    delete msg.payload[0][i].slot2;
}

delete msg.topic
msg.payload = msg.payload.slice(0, 1);
