var warna
var output = { "payload": [] }
var feed
var count1 = 0
var count2 = 0
var index1 = msg.payload.length
var index2 = msg.payload[count2].state.length

for (count2 = 0; count2 < index1; count2++) {
    for (count1 = 0; count1 < index2; count1++) {
        if (msg.payload[count2].state[count1] == 1) {
            warna = "red"
        }
        else {
            warna = "green"
        }
        delete (msg.topic)

        feed = {
            "command": "update_style",
            "selector": "#" + msg.payload[count2].level + msg.payload[count2].slot[count1] + "",
            "attributeName": "fill",
            "attributeValue": warna
        }
        output.payload.push(feed)
    }
}
node.status({ fill: "green", shape: "dot", text: "Success" })
return output

var output = { "payload": [] }
var count1 = 0
var count2 = 0
var index1 = msg.payload.length
var index2 = msg.payload[count2].state.length
var jml = [0, 0]

for (count2 = 0; count2 < index1; count2++) {
    for (count1 = 0; count1 < index2; count1++) {
        if (msg.payload[count2].level == "B1" && msg.payload[count2].state[count1] == 0) {
            jml[0]++
        }
        else if (msg.payload[count2].level == "B2" && msg.payload[count2].state[count1] == 0) {
            jml[1]++
        }
    }
}

if (jml[0] == 0) {
    output.payload.push({
        "command": "update_text",
        "selector": "#jmlParkirB1",
        "textContent": "     PENUH"
    })
}
else {
    output.payload.push({
        "command": "update_text",
        "selector": "#jmlParkirB1",
        "textContent": " Tersedia : " + jml[0]
    })
}

if (jml[1] == 0) {
    output.payload.push({
        "command": "update_text",
        "selector": "#jmlParkirB2",
        "textContent": "     PENUH"
    })
}
else {
    output.payload.push({
        "command": "update_text",
        "selector": "#jmlParkirB2",
        "textContent": " Tersedia : " + jml[1]
    })
}

node.status({ fill: "green", shape: "dot", text: "Success" })
return output

